//SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract New is AccessControl {
    // Create a new role identifier for the minter role
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    using SafeMath for uint256;

    uint256 public depositAmount;
    uint256 public amountToDeposit;
    uint256 public count;
    address public participantAddress;

    modifier onlyMinter(){
        require(hasRole(MINTER_ROLE, msg.sender), "Caller is not a minter");
      _;

    }
    constructor(address minter){
        // Grant the minter role to a specified account
     _setupRole(MINTER_ROLE, minter);

    }

     function onClick(bool _choice) public  {
        participantAddress = msg.sender;
        count += 1;
          if(count == 1){
            depositAmount = 100000000000000000000;

            }
        if (_choice) {
            amountToDeposit = 100000000000000000000; 


        }

    }

    function changeDepositAmount(bool _change,uint256 _newAmount ) public onlyMinter {
       require(count >= 1,"ACCEPTS THE INITIALIZED VALUE");
       if(_change){
          depositAmount = _newAmount;
       }else{
           depositAmount= amountToDeposit.add(10000000000000000000);
       }

    }
}

